import React, { Component } from 'react';

import { Carousel } from 'react-bootstrap';

import { Col} from 'react-materialize';

import ImagemCarousel1 from '../../images/fundoCarroussel/fundoCarroussel1.png';
import ImagemCarousel2 from '../../images/fundoCarroussel/fundoCarroussel2.png';
import ImagemCarousel3 from '../../images/fundoCarroussel/fundoCarroussel3.png';

class Carroussel extends Component {
  render() {
    return (
    	<Col s={12} m={12}>
	       <Carousel height={1000}>
			  <Carousel.Item>
			    <img width={2000} height={2000} src={ImagemCarousel1} />
			  </Carousel.Item>

			  <Carousel.Item>
			    <img width={2000} height={2000} src={ImagemCarousel2} />
			    <Carousel.Caption>
			      <h3>Second slide label</h3>
			      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
			    </Carousel.Caption>
			  </Carousel.Item>

			  <Carousel.Item>
			    <img width={2000} height={2000} src={ImagemCarousel3} />
			    <Carousel.Caption>
			      <h3>Third slide label</h3>
			      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
			    </Carousel.Caption>
			  </Carousel.Item>

			</Carousel>
		</Col>
    );
  }
}
export default Carroussel;
